import React from 'react';
import styled from 'styled-components';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import Header from '../components/Header';

const HomeContainer = styled.div`
  width: 100%;
`;

const CarouselSection = styled.section`
  margin-top: 80px;
  padding: 0;
`;

const CarouselSlide = styled.div`
  height: 70vh;
  background: linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), ${props => props.bgImage ? `url(${props.bgImage})` : 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)'};
  background-size: cover;
  background-position: center;
  display: flex;
  align-items: center;
  justify-content: center;
  text-align: center;
  position: relative;
`;

const SlideContent = styled.div`
  max-width: 800px;
  margin: 0 auto;
  padding: 0 20px;
  z-index: 2;
`;

const SlideTitle = styled.h2`
  font-size: 3rem;
  color: #ffffff;
  margin-bottom: 20px;
  font-weight: 700;
  text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.5);
`;

const SlideDescription = styled.p`
  font-size: 1.3rem;
  color: #ffffff;
  margin-bottom: 30px;
  opacity: 0.95;
  text-shadow: 1px 1px 2px rgba(0, 0, 0, 0.5);
`;

const SlideButton = styled.button`
  padding: 12px 30px;
  font-size: 1.1rem;
  background-color: #f2381a;
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  transition: all 0.3s ease;
  text-transform: uppercase;
  font-weight: 600;
  
  &:hover {
    background-color: #d42d15;
    transform: translateY(-2px);
  }
`;

const HeroSection = styled.section`
  height: 100vh;
  background: linear-gradient(rgba(0, 0, 0, 0.7), rgba(0, 0, 0, 0.7));
  background-size: cover;
  background-position: center;
  display: flex;
  align-items: center;
  justify-content: center;
  text-align: center;
  padding-top: 80px;
`;

const HeroContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
`;

const MainHeading = styled.h1`
  font-size: 4rem;
  color: #ffffff;
  margin-bottom: 20px;
  font-weight: 700;
`;

const SubHeading = styled.p`
  font-size: 1.5rem;
  color: #ffffff;
  margin-bottom: 40px;
  opacity: 0.9;
`;

const CTAButton = styled.button`
  padding: 15px 40px;
  font-size: 1.2rem;
  background-color: #f2381a;
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  transition: background-color 0.3s ease;

  &:hover {
    background-color: #d42d15;
  }
`;

const CustomCarousel = styled(Carousel)`
  .carousel .slide {
    background: transparent;
  }
  
  .carousel .control-dots {
    bottom: 20px;
  }
  
  .carousel .control-dots .dot {
    background: rgba(255, 255, 255, 0.5);
    width: 12px;
    height: 12px;
    margin: 0 8px;
  }
  
  .carousel .control-dots .dot.selected {
    background: #f2381a;
  }
  
  .carousel .control-arrow {
    background: rgba(0, 0, 0, 0.3);
    border-radius: 50%;
    width: 50px;
    height: 50px;
    top: 50%;
    transform: translateY(-50%);
  }
  
  .carousel .control-arrow:hover {
    background: rgba(0, 0, 0, 0.5);
  }
`;

const Home = () => {
  const carouselSlides = [
    {
      title: "Expert Nursing Care",
      description: "Professional healthcare services delivered with compassion and expertise to ensure the best patient outcomes.",
      buttonText: "Learn More"
    },
    {
      title: "24/7 Patient Support",
      description: "Round-the-clock nursing care and support services to meet your healthcare needs anytime, anywhere.",
      buttonText: "Contact Us"
    },
    {
      title: "Specialized Medical Services",
      description: "Comprehensive medical care tailored to individual patient needs with state-of-the-art equipment and techniques.",
      buttonText: "Our Services"
    },
    {
      title: "Home Healthcare Solutions",
      description: "Bringing professional nursing care to the comfort of your home with personalized treatment plans.",
      buttonText: "Get Started"
    }
  ];

  return (
    <>
      <Header />
      <HomeContainer>
        <HeroSection>
          <HeroContent>
            <MainHeading>Neutek Nursing Services</MainHeading>
            <SubHeading>Professional Healthcare Solutions for Your Needs</SubHeading>
            <CTAButton>Get Started</CTAButton>
          </HeroContent>
        </HeroSection>
        
        <CarouselSection>
          <CustomCarousel
            autoPlay
            infiniteLoop
            interval={4000}
            showThumbs={false}
            showStatus={false}
            swipeable
            emulateTouch
          >
            {carouselSlides.map((slide, index) => (
              <div key={index}>
                <CarouselSlide>
                  <SlideContent>
                    <SlideTitle>{slide.title}</SlideTitle>
                    <SlideDescription>{slide.description}</SlideDescription>
                    <SlideButton>{slide.buttonText}</SlideButton>
                  </SlideContent>
                </CarouselSlide>
              </div>
            ))}
          </CustomCarousel>
        </CarouselSection>
      </HomeContainer>
    </>
  );
};

export default Home;
